Script:
return {
    Init: function () {
        if (!this.ShipmentDetail) {
            var id = this.Uuid7.NewGuid();
            this.ShipmentDetail = {
                Id: id,
                Code: this.Entity.Code,
                ParentId: this.Entity.Id,
                TypeId: this.Entity.TypeId,
                ShipmentFreight: [
                    {
                        Id: this.Uuid7.NewGuid(),
                        ShipmentId: id,
                        PmTypeId: 1,
                    },
                    {
                        Id: this.Uuid7.NewGuid(),
                        ShipmentId: id,
                        PmTypeId: 2,
                    }
                ]
            };
            this.ShipmentDetail.FlightsDate = this.Entity.EtdDate;
            this.ShipmentDetail.VesselVoy = this.Entity.VesselVoy;
            this.ShipmentDetail.CommodityId = this.Entity.CommodityId;
            this.ShipmentDetail.PortTransitId = this.Entity.PortTransitId;
            this.ShipmentDetail.PlaceReceiptId = this.Entity.PolId;
            this.ShipmentDetail.PlaceDeliveryId = this.Entity.PodId;
            this.ShipmentDetail.SaillingDate = this.Entity.EtdDate;
            this.ShipmentDetail.IssueDate = this.Entity.EtaDate;
            this.ShipmentDetail.PlaceIssueId = this.Entity.PolId;
            this.ShipmentDetail.ForDeliveryGoodsId = this.Entity.AgentId;
            this.ShipmentDetail.PolId = this.Entity.PolId;
            this.ShipmentDetail.AirportDepartureId = this.Entity.PolId;
            this.ShipmentDetail.PlaceId = this.Entity.PolId;
            this.ShipmentDetail.PodId = this.Entity.PodId;
            this.ShipmentDetail.EtaDate = this.Entity.EtaDate;
            this.ShipmentDetail.EtdDate = this.Entity.EtdDate;
            this.ShipmentDetail.ExecutedDate = this.Entity.EtdDate;
            this.ShipmentDetail.To1 = this.Entity.Pod ? this.Entity.Pod.Code : null;
        }
        window.setTimeout(async () => {
            let agent = this.Entity.Agent;
            let agentText = "";
            if (agent) {
                agentText += `${(agent.CompanyName || '')}\n`;
                agentText += `${(agent.Address || '')}\n`;
                agentText += `Tell: ${(agent.PhoneNumber || '')} Fax: ${(agent.Fax || '')}\n`;
                agentText += `Contact person: ${(agent.ContactName || '')}`;
            }
            var entityTransit = this.EditForm.ChildCom.find(x => x.Meta.FieldName == "EntityTransit");
            if (entityTransit && entityTransit.AllListViewItem[0]) {
                this.EditForm.ShipmentDetail.To2 = entityTransit.AllListViewItem[0].Entity.PortTransit ? entityTransit.AllListViewItem[0].Entity.PortTransit.Code : null;
                this.EditForm.ShipmentDetail.CFlights1 = entityTransit.AllListViewItem[0].Entity.TransitNo;
                this.EditForm.ShipmentDetail.CFlights1Date = entityTransit.AllListViewItem[0].Entity.EtdTsDate;
            }
            if (entityTransit && entityTransit.AllListViewItem[1]) {
                this.EditForm.ShipmentDetail.To3 = entityTransit.AllListViewItem[1].Entity.PortTransit ? entityTransit.AllListViewItem[0].Entity.PortTransit.Code : null;
                this.EditForm.ShipmentDetail.CFlights2 = entityTransit.AllListViewItem[1].Entity.TransitNo;
                this.EditForm.ShipmentDetail.CFlights2Date = entityTransit.AllListViewItem[1].Entity.EtdTsDate;
            }
            this.EditForm.ShipmentDetail.ByFirstCarrier = this.Entity.Vendor ? this.Entity.Vendor.Name : null;
            this.EditForm.ShipmentDetail.ForDeliveryGoodsDes = agentText.trim();
            var cw = this.Decimal(this.EditForm.ShipmentDetail.GW || 0).greaterThan(this.Decimal(this.EditForm.Entity.VolumeWeight || 0)) ? this.Decimal(this.EditForm.ShipmentDetail.GW || 0) : this.Decimal(this.EditForm.Entity.VolumeWeight || 0);
            this.EditForm.ShipmentDetail.CW = cw;
            this.UpdateView2(false, false, "ShipmentDetail", "To2", "CFlights1", "CFlights1", "CFlights1Date", "To3", "CFlights2", "CFlights2Date", "ByFirstCarrier", "ForDeliveryGoodsDes", "CW");
            if (this.EditForm.ShipmentDetail.BookingLocalId) {
                var serviceBookingLocal = this.EditForm.FirstCom("ServiceBookingLocal");
                var datas = await serviceBookingLocal.RunQuerys();
                this.EditForm.BookingLocalDetail = datas[0];
            }
            else {
                this.EditForm.BookingLocalDetail = [];
            }
        }, 1000);
    },
    OnSave: function (form, gridview) {
        var hbl = this.EditForm.FirstCom("ShipmentDetail");
        if (hbl.Item && hbl.Item.length > 0) {
            this.Entity.SaleIds = [...new Set(hbl.Item.map(x => x.Entity.SaleId).filter(x => x != null))].join(",");
            hbl.Item.forEach(item => {
                item.Entity.VendorId = this.Entity.VendorId;
                item.Entity.MblNo = this.Entity.MblNo;
                item.Entity.MblTypeId = this.Entity.MblTypeId;
                item.Entity.CommodityId = item.Entity.CommodityId || this.Entity.CommodityId;
                item.Entity.ShipmentTypeId = item.Entity.ShipmentTypeId || this.Entity.ShipmentTypeId;
                item.Entity.CarrierId = item.Entity.CarrierId || this.Entity.CarrierId;
                item.Entity.DeliveryTermId = item.Entity.DeliveryTermId || this.Entity.DeliveryTermId;
                item.Entity.IncotermId = item.Entity.IncotermId || this.Entity.IncotermId;
            });
        }
        var costFee = this.EditForm.ChildCom.find(x => x.Parent.Meta.Label == "Costing");
        var revenue = this.EditForm.ChildCom.find(x => x.Parent.Meta.Label == "Revenue");
        if (costFee && costFee.Item && costFee.Item.length > 0) {
            costFee.Item.filter(x => !x.GroupRow).forEach((item, index) => {
                item.Entity.Order = index;
            });
        }
        if (revenue && revenue.Item && revenue.Item.length > 0) {
            revenue.Item.filter(x => !x.GroupRow).forEach((item, index) => {
                item.Entity.Order = index;
            });
        }
        this.Entity.SaleIds = [...new Set(hbl.Item.map(x => x.Entity.SaleId).filter(x => x != null))].join(",");
        if (!this.Entity.SaleIds) {
            this.Entity.SaleIds = this.EditForm.ShipmentDetail.SaleId;
        }
    },
    FirstLoadHBL: function () {
        window.setTimeout(() => {
            var hbl = this.EditForm.ChildCom.find(x => x.Meta.FieldName == "ShipmentDetail");
            if (this.EditForm.HblEntity) {
                var item = hbl.AllListViewItem.find(x => x.Entity.Id == this.EditForm.HblEntity.Id);
                if (hbl && hbl.AllListViewItem && item) {
                    item.Element.click();
                }
            }
            else {
                if (hbl && hbl.AllListViewItem && hbl.AllListViewItem[0]) {
                    hbl.AllListViewItem[0].Element.click();
                }
            }
        }, 1000);
    },
    CalcWeight: function (form, gridview) {
        var detail = this.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "EntityDimension");
        if ((detail && detail.AllListViewItem.length > 0)) {
            var rowData = detail.AllListViewItem.map(x => x.Entity);
            var volumeWeight = rowData.reduce((a, b) => a.plus(((this.Decimal(b.Width || 0)).times(this.Decimal(b.Height || 0)).times(this.Decimal(b.Length || 0))).times((this.Decimal(b.Quantity || 0))).div(this.Decimal(6000))), this.Decimal(0));
            this.EditForm.Entity.VolumeWeight = volumeWeight || this.Decimal(0);
            this.EditForm.UpdateView(false, false, "VolumeWeight");
        }
    },
    CalcTotalParent: function () {
        var hbl = this.EditForm.ChildCom.find(x => x.Meta.FieldName == "ShipmentDetail");
        var total = JSON.parse(JSON.stringify(hbl.Item.map(x => x.Entity)));
        if (this.EditForm.ShipmentDetail.Id.startsWith("-")) {
            total.push(this.EditForm.ShipmentDetail);
        }
        if (!total || total.length == 0) {
            this.EditForm.Entity.Quantity = null;
            this.EditForm.Entity.CBM = null;
            this.EditForm.Entity.GW = null;
            this.EditForm.Entity.CW = null;
            this.EditForm.Entity.UnitId = null;
        }
        else {
            this.EditForm.Entity.Quantity = total.reduce((acc, x) => acc.add(this.Decimal(x.Quantity || 0)), this.Decimal(0));
            this.EditForm.Entity.CBM = total.reduce((acc, x) => acc.add(this.Decimal(x.CBM || 0)), this.Decimal(0));
            this.EditForm.Entity.GW = total.reduce((acc, x) => acc.add(this.Decimal(x.GW || 0)), this.Decimal(0));
            this.EditForm.Entity.CW = total.reduce((acc, x) => acc.add(this.Decimal(x.CW || 0)), this.Decimal(0));
            this.EditForm.Entity.UnitId = total[0].UnitId;
        }
        this.EditForm.UpdateView(false, false, "Quantity", "CBM", "GW", "CW", "UnitId");
    },
    CalcWeightDetail: function (form, gridview) {
        var detail = this.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "EntityDimension1");
        if ((detail && detail.AllListViewItem.length > 0)) {
            var rowData = detail.AllListViewItem.map(x => x.Entity);
            var volumeWeight = rowData.reduce((a, b) => a.plus(((this.Decimal(b.Width || 0)).times(this.Decimal(b.Height || 0)).times(this.Decimal(b.Length || 0))).times((this.Decimal(b.Quantity || 0))).div(this.Decimal(6000))), this.Decimal(0));
            this.EditForm.ShipmentDetail.VolumeWeight = volumeWeight || this.Decimal(0);
            var cw = this.Decimal(this.EditForm.ShipmentDetail.GW || 0).greaterThan(this.Decimal(this.EditForm.ShipmentDetail.VolumeWeight || 0)) ? this.Decimal(this.EditForm.ShipmentDetail.GW || 0) : this.Decimal(this.EditForm.ShipmentDetail.VolumeWeight || 0);
            this.EditForm.ShipmentDetail.CW = cw;
            this.EditForm.UpdateView2(false, false, "ShipmentDetail", "VolumeWeight", "CW");
            this.EditForm.CalcTotalAir();
        }
    },
    AddDetail: function () {
        if (this.EditForm.ShipmentDetail.Id.startsWith("-")) {
            return;
        }
        var hbl = this.EditForm.ChildCom.find(x => x.Meta.FieldName == "ShipmentDetail");
        hbl.ClearSelected();
        var id = this.Uuid7.NewGuid();
        this.ShipmentDetail = {
            Id: id,
            ParentId: this.Entity.Id,
            TypeId: this.Entity.TypeId,
            PolId: this.Entity.PolId,
            Code: this.Entity.Code,
            PodId: this.Entity.PodId,
            EtaDate: this.Entity.EtaDate,
            EtdDate: this.Entity.EtdDate,
            Vessel: `${this.Entity.Vessel}/${this.Entity.VesselVoy}`,
            VesselVoy: this.Entity.VesselVoy,
            OceanVessel: `${this.Entity.OceanVessel}/${this.Entity.OceanVesselVoy}`,
            OceanVesselVoy: this.Entity.OceanVesselVoy,
            CommodityId: this.Entity.CommodityId,
            PortTransitId: this.Entity.PortTransitId,
            PlaceReceiptId: this.Entity.PolId,
            PlaceDeliveryId: this.Entity.PodId,
            ShipmentFreight: [
                {
                    Id: this.Uuid7.NewGuid(),
                    ShipmentId: id,
                    PmTypeId: 1,
                },
                {
                    Id: this.Uuid7.NewGuid(),
                    ShipmentId: id,
                    PmTypeId: 2,
                }
            ]
        };
        let agent = this.Entity.Agent;
        let agentText = "";
        if (agent) {
            agentText += `${(agent.CompanyName || '')}\n`;
            agentText += `${(agent.Address || '')}\n`;
            agentText += `Tell: ${(agent.PhoneNumber || '')} Fax: ${(agent.Fax || '')}\n`;
            agentText += `Contact person:${(agent.ContactName || '')}`;
        }
        this.ShipmentDetail.PolId = this.Entity.PolId;
        this.ShipmentDetail.AirportDepartureId = this.Entity.PolId;
        this.ShipmentDetail.PlaceId = this.Entity.PolId;
        this.ShipmentDetail.PodId = this.Entity.PodId;
        this.ShipmentDetail.EtaDate = this.Entity.EtaDate;
        this.ShipmentDetail.EtdDate = this.Entity.EtdDate;
        this.ShipmentDetail.ExecutedDate = this.Entity.EtdDate;
        this.ShipmentDetail.To1 = this.Entity.Pod ? this.Entity.Pod.Code : null;
        var entityTransit = this.ChildCom.find(x => x.Meta.FieldName == "EntityTransit");
        if (entityTransit && entityTransit.AllListViewItem[0]) {
            this.EditForm.ShipmentDetail.To2 = entityTransit.AllListViewItem[0].Entity.PortTransit ? entityTransit.AllListViewItem[0].Entity.PortTransit.Code : null;
            this.EditForm.ShipmentDetail.CFlights1 = entityTransit.AllListViewItem[0].Entity.TransitNo;
            this.EditForm.ShipmentDetail.CFlights1Date = entityTransit.AllListViewItem[0].Entity.EtdTsDate;
        }
        if (entityTransit && entityTransit.AllListViewItem[1]) {
            this.EditForm.ShipmentDetail.To3 = entityTransit.AllListViewItem[1].Entity.PortTransit ? entityTransit.AllListViewItem[1].Entity.PortTransit.Code : null;
            this.EditForm.ShipmentDetail.CFlights2 = entityTransit.AllListViewItem[1].Entity.TransitNo;
            this.EditForm.ShipmentDetail.CFlights2Date = entityTransit.AllListViewItem[1].Entity.EtdTsDate;
        }
        this.ShipmentDetail.ByFirstCarrier = this.Entity.Vendor ? this.Entity.Vendor.Name : null;
        this.ShipmentDetail.FlightsDate = this.Entity.EtdDate;
        this.ShipmentDetail.VesselVoy = this.Entity.VesselVoy;
        this.ShipmentDetail.CommodityId = this.Entity.CommodityId;
        this.ShipmentDetail.PortTransitId = this.Entity.PortTransitId;
        this.ShipmentDetail.PlaceReceiptId = this.Entity.PolId;
        this.ShipmentDetail.PlaceDeliveryId = this.Entity.PodId;
        this.ShipmentDetail.SaillingDate = this.Entity.EtdDate;
        this.ShipmentDetail.IssueDate = this.Entity.EtaDate;
        this.ShipmentDetail.PlaceIssueId = this.Entity.PolId;
        this.ShipmentDetail.ForDeliveryGoodsId = this.Entity.AgentId;
        this.ShipmentDetail.ForDeliveryGoodsDes = agentText.trim();
        var cw = this.Decimal(this.EditForm.ShipmentDetail.GW || 0).greaterThan(this.Decimal(this.EditForm.Entity.VolumeWeight || 0)) ? this.Decimal(this.EditForm.ShipmentDetail.GW || 0) : this.Decimal(this.EditForm.Entity.VolumeWeight || 0);
        this.EditForm.ShipmentDetail.CW = cw;
        this.UpdateView2(false, false, "ShipmentDetail");
    },
    ViewDetail: async function (com, entity) {
        this.ShipmentDetail = entity;
        if (this.EditForm.ShipmentDetail.BookingLocalId) {
            var serviceBookingLocal = this.EditForm.FirstCom("ServiceBookingLocal");
            var datas = await serviceBookingLocal.RunQuerys();
            this.EditForm.BookingLocalDetail = datas[0];
        }
        else {
            this.EditForm.BookingLocalDetail = [];
        }
        if (this.Dirty) {
            this.SaveEntity("ShipmentDetail", "Shipment").then(() => {
                this.ShipmentDetail.Code = this.EditForm.Entity.Code;
                this.UpdateView2(false, false, "ShipmentDetail");
                this.UpdateView(false, false, "btnIssueInvoice", "btnPrint");
            });
        }
        else {
            this.ShipmentDetail.Code = this.EditForm.Entity.Code;
            this.UpdateView2(false, false, "ShipmentDetail");
            this.UpdateView(false, false, "btnIssueInvoice", "btnPrint");
        }
    },
    SetDefaultQuantity: function (com, entity) {
        if (entity.Unit && entity.Unit.IsCBM) {
            entity.Quantity = this.Decimal(this.EditForm.ShipmentDetail.CBM || 1);
        }
        else if (entity.Unit && entity.Unit.IsKGS) {
            entity.Quantity = this.Decimal(this.EditForm.ShipmentDetail.CW || 1);
        }
        else if (entity.Unit && entity.Unit.IsGW) {
            entity.Quantity = this.Decimal(this.EditForm.ShipmentDetail.GW || 1);
        }
        if (entity.UnitId && entity.UnitId == this.EditForm.ShipmentDetail.UnitId) {
            entity.Quantity = this.Decimal(this.EditForm.ShipmentDetail.Quantity || 1);
        }
        if (entity.IsGrossWeight) {
            entity.Quantity = this.Decimal(this.EditForm.ShipmentDetail.GW || 1);
        }
        entity.Amount = this.Decimal(entity.Amount || 0);
        entity.TotalAmount = this.Decimal(entity.Quantity || 0).times(this.Decimal(entity.Amount || 0));
        if ((this.Decimal(entity.Vat || 0)).isNegative()) {
            entity.AmountTax = this.Decimal(entity.Vat).abs();
        } else {
            entity.AmountTax = (entity.TotalAmount).times(this.Decimal(entity.Vat || 0)).div(100);
        }
        entity.TotalAmountTax = entity.TotalAmount.plus(entity.AmountTax);
        com.Parent.UpdateView(false);
    },
    ChangeTransitPort: function (com, entity) {
        var entityTransit = this.EditForm.ChildCom.find(x => x.Meta.FieldName == "EntityTransit");
        if (entityTransit && entityTransit.AllListViewItem[0]) {
            this.Entity.PortTransitId = entityTransit.AllListViewItem[0].Entity.PortTransitId;
        }
        if (entityTransit && entityTransit.AllListViewItem[1]) {
            this.Entity.PortTransit2Id = entityTransit.AllListViewItem[1].Entity.PortTransitId;
        }
        this.DefaultDetail();
    },
    OnSaved: function () {
        this.ShipmentDetail.ParentId = this.Entity.Id;
        this.ShipmentDetail.TypeId = this.Entity.TypeId;
        this.SaveEntity("ShipmentDetail", "Shipment");
    },
    CalcPrice: function (com, entity) {
        entity.Quantity = this.Decimal(entity.Quantity || 0);
        entity.Amount = this.Decimal(entity.Amount || 0);
        entity.TotalAmount = this.Decimal(entity.Quantity || 0).times(this.Decimal(entity.Amount || 0));
        if ((this.Decimal(entity.Vat || 0)).isNegative()) {
            entity.AmountTax = this.Decimal(entity.Vat).abs();
        } else {
            entity.AmountTax = (entity.TotalAmount).times(this.Decimal(entity.Vat || 0)).div(100);
        }
        entity.TotalAmountTax = entity.TotalAmount.plus(entity.AmountTax);
        com.Parent.UpdateView(false);
    },
    CalcUnitPrice: function (com, entity) {
        entity.IsManual = true;
        entity.Quantity = this.Decimal(entity.Quantity || 0);
        entity.TotalAmountTax = this.Decimal(entity.TotalAmountTax || 0);
        if ((this.Decimal(entity.Vat || 0)).isNegative()) {
            entity.AmountTax = this.Decimal(entity.Vat).abs();
            entity.TotalAmount = entity.TotalAmountTax.minus(entity.AmountTax);
        } else {
            entity.TotalAmount = entity.TotalAmountTax.div(this.Decimal(1).plus((this.Decimal(entity.Vat || 0)).div(100)));
            entity.AmountTax = entity.TotalAmount.times(this.Decimal(entity.Vat || 0)).div(100);
        }
        entity.Amount = entity.TotalAmount.div(entity.Quantity || this.Decimal(1));
        com.Parent.UpdateView(false);
    },
    CalcOtherFee: function (com, entity) {
        var qty = this.Decimal(com.EditForm.Entity.CW || 0);
        if (entity.Based.Name == 'GW') {
            qty = this.Decimal(com.EditForm.Entity.GW || 0);
        }
        entity.TotalPrice = this.Decimal(entity.UnitPrice || 0).times(qty);
        com.Parent.UpdateView(false);
    },
    Finnish: function (com, entity) {
        entity.FinishDate = this.dayjs();
        com.Parent.UpdateView(false);
    },
    BeforeCreated: function (rowSection, entity, listView) {
        if (listView) {
            var item = listView.AllListViewItem[listView.AllListViewItem.length - 1];
            if (item) {
                entity.VendorId = entity.VendorId || item.Entity.VendorId;
            }
        }
    },
    AddDuplicateMenu: function (form, gridview) {
        gridview.MenuItems.push({
            Icon: "fal fa-file-import",
            Text: "Copy From HBL",
            Click: () => this.CopyFeeFromHBL(form, gridview)
        });
        gridview.MenuItems.push({
            Icon: "fal fa-folders",
            Text: "Duplicate",
            Click: () => this.DuplicateFee(form, gridview)
        });
        var selecteds = form.Item.filter(x => !x.GroupRow && x.Selected);
        if (!selecteds.some(x => x.Entity.IsLock || x.Entity.IsPayment || x.Entity.IsInvoice)) {
            gridview.MenuItems.push({
                Icon: "fal fa-calculator-alt",
                Text: "Calc Tax XXX",
                Click: () => this.CalcTax(form, gridview)
            });
        }
    },
    CalcTax: function (gridview) {
        var selecteds = gridview.Item.filter(x => !x.GroupRow && x.Selected);
        var numerator = this.Decimal(5).div(100);
        var denominator = this.Decimal(1).minus(numerator);
        var vat = numerator.div(denominator);
        for (var itemView of selecteds) {
            itemView.Entity.TotalAmountTax = this.Decimal(itemView.Entity.TotalAmountTax || 0);
            itemView.Entity.AmountTax = itemView.Entity.TotalAmountTax.times(vat).div(vat.plus(1)).toDecimalPlaces(0);
            itemView.Entity.Amount = itemView.Entity.TotalAmountTax.sub(itemView.Entity.AmountTax);
            itemView.Entity.Vat = itemView.Entity.AmountTax.negated();
            itemView.Entity.IsManual = true;
            itemView.UpdateView(false);
            itemView.Dirty = true;
        }
        window.clearTimeout(this.EditForm.IntUpdateFee);
        this.EditForm.IntUpdateFee = window.setTimeout(() => {
            this.ReloadSummary();
        }, 500)
    },
    DuplicateFee: function (gridview) {
        var newItem = JSON.parse(JSON.stringify(gridview.Header.filter(x => x.FieldName == "VendorId" || x.FieldName == "IsNoDocs")));
        var costFee = gridview.EditForm.ChildCom.find(x => x.Parent.Meta.Label == "Costing");
        var revenue = gridview.EditForm.ChildCom.find(x => x.Parent.Meta.Label == "Revenue");
        if (gridview.Meta.Id == costFee.Meta.Id) {
            if (!this.Token.RoleNames.some(x => x.toUpperCase() == "CRUD REVENUE")) {
                newItem = newItem.filter(x => x.FieldName == "VendorId");
            }
            gridview.EditForm.ShipmentDetail.ViewIsBuying = false;
        }
        else {
            if (!this.Token.RoleNames.some(x => x.toUpperCase() == "CRUD COSTING")) {
                gridview.EditForm.ShipmentDetail.ViewIsBuying = false;
                newItem = newItem.filter(x => x.FieldName == "VendorId");
            }
            else {
                gridview.EditForm.ShipmentDetail.ViewIsBuying = true;
            }
        }
        newItem.forEach(item => {
            if (item.FieldName == "IsNoDocs") {
                item.FieldName = "IsBuying";
                item.Label = "Buying";
            }
            item.FieldName = "View" + item.FieldName;
        })
        var form = gridview.EditForm.OpenConfig("Please select Payer/Payee!", () => {
            if (!form.EditForm.ShipmentDetail.ViewVendorId) {
                return;
            }
            var selecteds = gridview.Item.filter(x => !x.GroupRow && x.Selected);
            var newFees = JSON.parse(JSON.stringify(selecteds.map(x => x.Entity)));
            if (form.EditForm.ShipmentDetail.ViewIsBuying) {
                newFees.forEach(f => {
                    f.Id = form.EditForm.Uuid7.NewGuid();
                    f.VendorId = form.EditForm.ShipmentDetail.ViewVendorId;
                    f.TypeId = 2;
                    f.Amount = null;
                    f.Vat = null;
                    f.TotalAmount = null;
                    f.AmountTax = null;
                    f.TotalAmountTax = null;
                    f.IsLock = false;
                    f.ParentId = null;
                    this.EditForm.ResetFee(f);
                });
                costFee.LoadMasterData(newFees).then(() => {
                    costFee.ClearSelected();
                    costFee.AddRows(newFees).then(rows => {
                        rows.forEach(row => {
                            row.Selected = true;
                        });
                        if (rows[0]) {
                            rows[0].Element.focus();
                        }
                    });
                });
            }
            else {
                newFees.forEach(f => {
                    f.Id = form.EditForm.Uuid7.NewGuid();
                    f.VendorId = form.EditForm.ShipmentDetail.ViewVendorId;
                    f.TypeId = 1;
                    f.Amount = null;
                    f.Vat = null;
                    f.TotalAmount = null;
                    f.AmountTax = null;
                    f.TotalAmountTax = null;
                    f.IsLock = false;
                    f.ParentId = null;
                    this.EditForm.ResetFee(f);
                });
                revenue.LoadMasterData(newFees).then(() => {
                    revenue.ClearSelected();
                    revenue.AddRows(newFees).then(rows => {
                        rows.forEach(row => {
                            row.Selected = true;
                        });
                        if (rows[0]) {
                            rows[0].Element.focus();
                        }
                    });
                });
            }
        }, () => { }, true, newItem);
    },
    CopyFeeFromHBL: function (gridview) {
        if (gridview.Meta.Label == "Revenue") {
            this.EditForm.Entity.OptionIds = "1,5";
            var newItem = JSON.parse(JSON.stringify(this.EditForm.Meta.GridPolicies.filter(x => x.EntityId == "CopyFeeFromHBL")));
            var form = gridview.EditForm.OpenConfig("Please select HBL copy Revenue!", async () => {
