    CalcFreight: function () {
        var shipmentFreight = this.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "ShipmentFreight");
        var otherFee = this.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "OtherFee");
        var feeAgent = otherFee.Item.filter(x => x.Entity.VendorId == this.EditForm.Entity.AgentId).map(x => x.Entity);
        var feeCarrier = otherFee.Item.filter(x => x.Entity.VendorId == this.EditForm.Entity.CarrierId).map(x => x.Entity);
        var totalAgent = feeAgent.length == 0 ? this.Decimal(0) : feeAgent.reduce((a, b) => a.plus(this.Decimal(b.TotalAmount || 0)));
        var totalCarrier = feeCarrier.length == 0 ? this.Decimal(0) : feeCarrier.reduce((a, b) => a.plus(this.Decimal(b.TotalAmount || 0)));
        var collItem = shipmentFreight.Item[0];
        var ppdItem = shipmentFreight.Item[1];
        if (this.EditForm.ShipmentDetail.WTVAL && this.EditForm.ShipmentDetail.WTVAL.Name == "Collect" && collItem) {
            collItem.Entity.WeightCharge = this.EditForm.ShipmentDetail.Total || this.Decimal(0);
            collItem.Entity.TotalDueAgent = totalAgent;
            collItem.Entity.TotalDueCarrier = totalCarrier;
            collItem.Entity.Total = collItem.Entity.WeightCharge.div(this.Decimal(1).plus((collItem.Entity.Tax || this.Decimal(0)).div(100)));
            collItem.UpdateView(true, false);
            ppdItem.Entity.WeightCharge = null;
            ppdItem.Entity.TotalDueAgent = null;
            ppdItem.Entity.TotalDueCarrier = null;
            ppdItem.Entity.Total = null;
            ppdItem.Entity.Tax = null;
            ppdItem.UpdateView(true, false);
        }
        if (this.EditForm.ShipmentDetail.WTVAL && this.EditForm.ShipmentDetail.WTVAL.Name == "Prepaid" && ppdItem) {
            ppdItem.Entity.WeightCharge = this.EditForm.ShipmentDetail.Total || this.Decimal(0);
            ppdItem.Entity.TotalDueAgent = totalAgent;
            ppdItem.Entity.TotalDueCarrier = totalCarrier;
            ppdItem.Entity.Total = ppdItem.Entity.WeightCharge.div(this.Decimal(1).plus((ppdItem.Entity.Tax || this.Decimal(0)).div(100)));
            ppdItem.UpdateView(true, false);
            collItem.Entity.WeightCharge = null;
            collItem.Entity.TotalDueAgent = null;
            collItem.Entity.TotalDueCarrier = null;
            collItem.Entity.Total = null;
            collItem.Entity.Tax = null;
            collItem.UpdateView(true, false);
        }
        this.UpdateView2(false, false, "ShipmentDetail", "Total");
    },
    CalcTotalFreight: function (com, entity) {
        entity.WeightCharge = this.Decimal(entity.WeightCharge || 0);
        entity.TaxRate = this.Decimal(entity.Tax || 0).div(100);
        entity.Total = entity.WeightCharge.times(this.Decimal(1).plus(entity.TaxRate));
        com.Parent.UpdateView(false);
