    }, this.Decimal(0))),
    ActualCost: (costing.reduce((a, b) => {
        let rate = this.Decimal(b.ExchangeRateUSD);
        return a.plus(rate.eq(0) ? this.Decimal(0) : this.Decimal(b.TotalAmount || 0)[(b.CurrencyCode == "USD" || b.CurrencyCode == "VND") ? 'times' : 'div'](rate));
    }, this.Decimal(0))),
    EstimateProfit: 0,
    EstimatePerProfit: 0,
    ActualProfit: 0,
    ActualPerProfit: 0
};

